__NUXT_JSONP__("/adopt/alfie", (function(a,b,c,d,e,f){return {data:[{chihuahua:d,chihuahuaSE:d,chihuahuaMW:{_createdAt:"2021-05-09T16:33:36Z",_id:"d3e570d5-86d5-48c1-8b4e-ee6fac6810be",_rev:"yXwlT3WstaCz55q6hnro0S",_type:"chihuahuasMW",_updatedAt:"2021-05-09T23:57:34Z",age:"10-years-old",chihuahua:"Alfie",description:[{_key:"b698ca74170c",_type:a,children:[{_key:"538fabad8527",_type:b,marks:[],text:"Who’s a good boy? Me, Alfie! I’m a 10-year-old, 13-pound male chihuahua, fully vetted, neutered, vaccinated, microchipped, and on heartworm preventative. I’m looking for a forever family. Do you have one to share?"}],markDefs:[],style:c},{_key:"3d0d1b0d8d25",_type:a,children:[{_key:"1bfffc24f7ba0",_type:b,marks:[],text:"My foster dad says I’m the best dog he’s ever fostered, period. I can’t say I’m surprised. I’m an expert cuddler, a world-class kisser, and an award-winning snuggle-buddy! I get along great with other dogs and am gentle with kids too. What’s not to love?!"}],markDefs:[],style:c},{_key:"a8523098d135",_type:a,children:[{_key:"0a64a5bc39f00",_type:b,marks:[],text:"Before coming to the rescue, I tested positive for heartworms. I’ve been through treatment and I’m doing great, but I’ll need a vet visit soon to make sure I’m fully recovered."}],markDefs:[],style:c},{_key:"8432246c5aa7",_type:a,children:[{_key:"e035ab6a6a1f0",_type:b,marks:[],text:"Are you ready to meet your new best friend? I can’t wait to show you all my good boy moves!"}],markDefs:[],style:c},{_key:"d443ba91fdc4",_type:a,children:[{_key:"ea6ed7cb3fd60",_type:b,marks:[],text:"Alfie’s adoption fee is $250. If you are interested in adopting Alfie, please DO NOT SEND A MESSAGE TO OUR RESCUE GROUP. We are too busy placing dogs in great homes to answer messages and inquiries through the listing site."}],markDefs:[],style:c},{_key:"d1b614138f60",_type:a,children:[{_key:"257b9abde1b30",_type:b,marks:[],text:"PLEASE GO TO THE LINK BELOW TO COMPLETE AN ADOPTION APPLICATION."}],markDefs:[],style:c},{_key:"1e158d1e8bbd",_type:a,children:[{_key:"51d18eba6ec10",_type:b,marks:[],text:"CRT requires an approved adoption application and a home visit for all adoption applicants. CRT transports to OH, KY, IL, MI, MN, WI."}],markDefs:[],style:c}],gender:"male",imageTwo:{_type:e,asset:{_ref:"image-570bd0f066f027d3e2e56b725e5c19626b15ae23-768x768-jpg",_type:f}},mainImage:{_type:e,asset:{_ref:"image-4ac89d5f3144a3c3322b782fc69e3bf6867bb6f4-768x771-jpg",_type:f}},neuteredSpayed:"Yes",order:5,region:"midwest",slug:{_type:"slug",current:"alfie"},status:"Available",tagline:"An expert cuddler and an award-winning snuggle-buddy!",weight:"13 pounds"}}],fetch:[],mutations:[]}}("block","span","normal",null,"image","reference")));